style.css:
@-moz-document url-prefix("https://newerp.kluniversity.in/index.php?r=site%2Findexindi") {
#navbar,.collapse,.nav{
        background:linear-gradient(45deg,#f0de22,#e96179,#bd14bd,#5b5bff) ;
        background-size :400%;
        animation:circnav 2s infinity alternate;
    }
    @keyframes circnav{
    from{
          background-position:left;
        }
        to{
            background-position:right;
        }
        
  }
}
